import { TypeAnimation } from 'react-type-animation';


export default function Home() {
    return (
        <div>
            <TypeAnimation
                sequence={
                [
                    "Print('Hello World')",
                    1000,
                    "Print('Hello",
                    1000,
                    "Print('Hello, I'm Astonished Orca'",
                    1000,
                    ]} />
                ]
                }
            />
        </div>
    );
}
